    false,nt"url": null,nt"notes": "This report provides a detailed summary
    of the baseline wilderness character assessment completed for the Harney Lake Wilderness
    on the Malheur National Wildlife Refuge.  The purpose of this report is multi-dimensional.
    It establishes a wilderness character monitoring program for the Harney Lake Wilderness
    and provides baseline data for future trend analysis. An understanding of the information
    in this report may also aid resource specialists by informing management decisions
    within the Harney Lake Wilderness. Finally, this report is meant to accompany and
    explain the quantitative results of Harney Lake's wilderness character assessment
    that have been entered into a national wilderness character monitoring database.
     A total of 19 measures were used to assess the following: untrammeled quality,
    natural quality, undeveloped quality, and solitude or primitive and unconfined recreation
